import React from 'react';
import Box3 from './Box3';



const style = {display:'flex' , flexDirection:'column' , justifyContent:'center',  backgroundColor: 'blue', width: '700px' , height:'400px' };

const Box2 = () => {
  return (
		<div className="box2" style={style}>
    	<Box3 />
		</div>

  );
};

export default Box2;
